import React from 'react'
import "./Navbar.css"


import "/node_modules/bootstrap/dist/js/bootstrap"
import "/node_modules/bootstrap/dist/js/bootstrap.bundle"
import "/node_modules/bootstrap/dist/js/bootstrap.esm"

function Navbar() {
    const Slide = () => {
        const liners = document.querySelector('.lines');

        const nav = document.querySelector('.navLinks');
        liners.addEventListener('click', () => {
            nav.classList.toggle('navactive');
        });


    }
    Slide();
    return (
        <nav class="navbar">
            <div class="logo">
            </div>

            <ul class="navLinks">
                <li><a href="Home.php" class="link" style="text-decoration:underline ;">Home</a></li>

                <li><a href="About.html" class="link">About</a></li>


            </ul>


            <div class="lines">
                <div class="line1"></div>
                <div class="line2"></div>
                <div class="line3"></div>
            </div>
        </nav>
    )
}

export default Navbar
